def stackoverflow_we(words):
    print("please wait ... \n")
    from gensim.models.keyedvectors import KeyedVectors
    word_vect = KeyedVectors.load_word2vec_format("SO_vectors_200.bin", binary=True)
    print("now processing your keywords... \n")
    dic = []
    for w in words:
        try:
            keys = str(word_vect.most_similar(w))
            dic.append(keys)
        except KeyError as e:
            print(e)
    return dic

